<template>
    <headerComponent />
    <div class="wrap">
        <div class="arrows">
            <svg xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" width="233px" height="592px">
                <image x="0px" y="0px" width="233px" height="592px"
                    xlink:href="data:img/png;base64," />
            </svg>
        </div>

        <div class="wrap-container">
            <div class="news-text">
                News
            </div>
            <div class="main-news-container">
                <img src="../assets/img/mainImg.png" alt="Out team">
            </div>
            <div class="news-container" v-if="newsArray && newsArray.length > 0">
                <div class="news-absolute">
                    <div v-if="newsArray" v-for="(news, index) in newsArray.slice(-3).reverse()" :key="index" class="news-item" :data-id="news._id">
                        <a :data-id="news._id" @click="goToNews(event)">
                            <img :src="news.previewImg" :data-id="news._id" :alt="news.title">
                        </a>
                    </div>
                </div>
                <a @click="this.$router.push('/news')" class="all-news">
                    All News
                </a>
            </div>
            
            
        </div>
    </div>
    <resultLine />
    <div class="news-section">
        <div class="news-section__container">
            <div class="news-block">
                <div class="news-block__title red-title-text">
                    NEWS DER AKTIVEN
                </div>
                <div class="video-block">
                    <video  ref="myVideo" @play="videoPlay" @pause="videoPause" @ended="videoEnded" >
                        <source src="/uploads/media/video.mp4"  type="video/mp4">

                    </video>
                    <img class="play-btn" v-if="showPlayButton" alt="Play Button" @click="playPause" style="cursor: pointer;" src="/uploads/media/play.png">
                </div>
                <redButton path="/gallery" text="Watch Video"/>
            </div>
            <div class="news-block constructor">
               
                <div class="news-block__title red-title-text">
                    NEWS AUS DER JUGEND
                </div>
                
                <div class="video-block" v-if="galleryArray">
                    <div class="constructor-container">
                        <div class="main-img-container">
                            <img class="main-image" :src="galleryArray.length > 0 ? galleryArray[0].previewImg : ''" alt="">
                        </div>
                        <div class="subcontainer">
                            <div class="image-container">
                                <div class="image-subcontainer">
                                    <img class="main-image" :src="galleryArray.length > 0 ? galleryArray[1].previewImg : ''" alt="">
                                </div>
                            </div>
                           
                            <div class="image-container">
                                <div class="image-subcontainer">
                                    <img class="main-image" :src="galleryArray.length > 0 ? galleryArray[2].previewImg : ''" alt="">
                                </div>
                            </div>
                        </div>
                    </div>
                   
                  
                </div>
                <redButton path="/gallery" text="View gallery"/>
            </div>
        </div>
    </div>
    <galleryPreview  class="gallery-component"/>
    <socialMedia class="social-section"/>
   

    <loginComponent v-if="showPopup" :eventHandler="openPopup" />
    <registerComponent v-if="showRegisterPopup" :eventHandler="openRegisterPopup" />
    <footerComponent /> 




</template>
<script>
import resultLine from '../components/resultLine.vue';
import axios from 'axios'
import redButton from '../components/redButton.vue';
import galleryPreview from '../components/galleryPreview.vue'
import loginComponent from '../components/loginComponent.vue';
import headerComponent from '../components/headerComponent.vue';
import socialMedia from '../components/socialMedia.vue';
import footerComponent from '../components/footerComponent.vue'
import registerComponent from '../components/registerComponent.vue'
export default {
    components: {
        resultLine,
        redButton,
        galleryPreview,
        loginComponent,
        headerComponent, 
        registerComponent,
        socialMedia,
        footerComponent
    },

    data () {
        return {
            showPopup: false,
            showRegisterPopup: false,
            newsArray: [],
            galleryArray: [],
            showPlayButton: true,

        }
    },

    methods: {
        openPopup () {
            console.log('openPopup method is called');

            this.showPopup = true;
        },
        closePopup () {
            console.log('openPopup method is called');

            this.showPopup = false;
        },

        openRegisterPopup () {
            this.showRegisterPopup = true;
        },
        closeRegisterPopup () {
            console.log('openPopup method is called');

            this.showRegisterPopup = false;
        },

        getNews () {
            axios.get('http://localhost:3000/api/news')
            .then((response) => {
                this.newsArray = response.data;
                console.log(this.newsArray)
            })
            .catch((error) => {
                console.log('Error whine get news list', error)
            })
        },

        goToNews () {
            var dataId = event.target.getAttribute('data-id');
            this.$router.push(`/news/${dataId}`)
        },

       getGalleryItems () {
        axios.get('http://localhost:3000/gallery')
        .then((response) => {
            this.galleryArray = response.data.slice(-3)
            console.log(this.galleryArray)
        })
        .catch((error) => {
            console.log('Error while get data', error)
        })
       },



    //    Video func
    playPause() {
      const video = this.$refs.myVideo;

      if (video.paused) {
        video.play();
      } else {
        video.pause();
      }
    },
    videoPlay() {
      this.showPlayButton = false; //    
    },
    videoPause() {
      this.showPlayButton = true; //    
    },
    videoEnded() {
      this.showPlayButton = true; //     
    },
    },
    
    mounted () {
        this.getNews()
        this.getGalleryItems()
    }
  
    
};
</script>
<style scoped>
@import url(../assets/styles/mainPage.css);
@import url(../assets/styles/mainPageResponsive.css);
</style>